INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("カオリ（サマー）", 4, "2030/12/17 14:59:59", "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 24, 0.0, 0.0, 4, 24015, 10021, 0.0, 110501, "2019/07/31 12:00:00", 1);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("カオリ（サマー）", 1, "2030/12/17 14:59:59", "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 24, 4.0, 0.0, 4, 24016, 10021, 0.0, 110501, "2019/07/31 12:00:00", 2);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("カオリ（サマー）", 4, "2030/12/17 14:59:59", "マジムンだらけで目が回るさ～！\nふらふらさ～！", 24, 0.0, 0.0, 4, 24017, 10021, 0.0, 110501, "2019/07/31 12:00:00", 3);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("カオリ（サマー）", 2, "2030/12/17 14:59:59", "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 24, 5.2, 0.0, 1, 24018, 10021, 0.0, 110501, "2019/07/31 12:00:00", 4);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("カオリ（サマー）", 6, "2030/12/17 14:59:59", "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 24, 4.2, 0.0, 5, 24019, 10021, 0.0, 110501, "2019/07/31 12:00:00", 5);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("カオリ（サマー）", 2, "2030/12/17 14:59:59", "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 24, 0.0, 0.0, 2, 24020, 10021, 0.0, 110501, "2019/07/31 12:00:00", 6);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("カオリ（サマー）", 6, "2030/12/17 14:59:59", "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 24, 6.4, 0.0, 1, 24021, 10021, 0.0, 110501, "2019/07/31 12:00:00", 7);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("カオリ（サマー）", 2, "2030/12/17 14:59:59", "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 24, 0.0, 0.0, 2, 24022, 10021, 0.0, 110501, "2019/07/31 12:00:00", 8);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("カオリ（サマー）", 3, "2030/12/17 14:59:59", "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 24, 10.08, 0.0, 6, 24023, 10021, 0.0, 110501, "2019/07/31 12:00:00", 9);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("カオリ（サマー）", 2, "2030/12/17 14:59:59", "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 24, 5.0, 0.0, 1, 24024, 10021, 0.0, 110501, "2019/07/31 12:00:00", 10);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("カオリ（サマー）", 2, "2030/12/17 14:59:59", "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 24, 0.0, 0.0, 2, 24025, 10021, 0.0, 110501, "2019/07/31 12:00:00", 11);
